function Filter(props) {
  const position = {
    container: props.boolean ? "hidden" : "w-56",
  };
  const design = {
    hr: "h-px bg-gray-200 w-2/3 my-4",
  };
  function onChange(e) {
    console.log(e.target);
  }
  function onClick(e) {
    console.log(e.target);
  }
  return (
    <div className={position.container}>
      <Price
        items={["0-1000", "1000-2000", "2000-3000"]}
        onChange={props.onChange}
      />
      <hr className={design.hr} />
      <Discount items={["0-10", "10-20", "20-30"]} onChange={props.onChange} />
      <hr className={design.hr} />
      <Color
        items={["green", "blue", "red", "yellow", "gray"]}
        onClick={props.onClick}
      />
      <hr className={design.hr} />
      <Size items={["5", "6", "7", "8"]} onClick={props.onClick} />
    </div>
  );
}

export default Filter;

// Sub-components

function Price(props) {
  const position = {
    heading: "pb-3",
    itemwrapper: "flex gap-2 items-center pb-2",
  };
  const design = {
    heading: "font-medium",
    text: "text-sm",
    input: "w-3.5 h-3.5",
  };

  return (
    <div>
      <h4 className={`${position.heading} ${design.heading}`}>Price</h4>
      {props.items.map((item) => {
        const [start, end] = item.split("-");
        return (
          <label key={item} className={position.itemwrapper}>
            <input
              className={design.input}
              type="radio"
              name="price"
              value={item}
              onChange={(e) => props.onChange(e)}
            />
            <span className={design.text}>
              ${start} - ${end}
            </span>
          </label>
        );
      })}
    </div>
  );
}

function Discount(props) {
  const position = {
    heading: "pb-3",
    itemwrapper: "flex gap-2 items-center pb-2",
  };
  const design = {
    heading: "font-medium",
    text: "text-sm",
    input: "w-3.5 h-3.5",
  };

  return (
    <div>
      <h4 className={`${position.heading} ${design.heading}`}>Discount</h4>
      {props.items.map((item) => {
        const [start, end] = item.split("-");
        return (
          <label key={item} className={position.itemwrapper}>
            <input
              className={design.input}
              type="radio"
              name="price"
              value={item}
              onChange={(e) => props.onChange(e)}
            />
            <span className={design.text}>
              {start}% - {end}%
            </span>
          </label>
        );
      })}
    </div>
  );
}

function Color(props) {
  const position = {
    heading: "pb-3",
    itemwrapper: "grid grid-cols-3 gap-2 w-2/3 pb-4 *:w-6 *:h-6",
  };
  const design = {
    heading: "font-medium",
    item: "border hover:border-gray-900 rounded-2xl cursor-pointer",
  };

  return (
    <div>
      <h4 className={`${position.heading} ${design.heading}`}>Color</h4>
      <div className={position.itemwrapper}>
        {props.items.map((item) => (
          <p
            key={item}
            onClick={(e) => props.onClick(e)}
            className={`${design.item} bg-${item}-400`}
          ></p>
        ))}
      </div>
    </div>
  );
}

function Size(props) {
  const position = {
    heading: "pb-3",
    itemwrapper: "grid grid-cols-2 w-2/3 gap-2 *:pt-1 *:w-10 *:h-9 *:m-auto",
  };
  const design = {
    heading: "font-medium",
    item: "border border-gray-300 text-center rounded-xl cursor-pointer hover:border-gray-900",
  };

  return (
    <div>
      <h4 className={`${position.heading} ${design.heading}`}>Size</h4>
      <div className={position.itemwrapper}>
        {props.items.map((item) => (
          <p
            key={item}
            onClick={(e) => props.onClick(e)}
            className={design.item}
          >
            {item}
          </p>
        ))}
      </div>
    </div>
  );
}
